import { CheckBox } from "./CheckBox"

export const SideBar=()=>{
    return(
        <div className="sidebar">
            <CheckBox value="Есть на складе"/>
            <h3> Категории: </h3>

            <CheckBox value="Смартфоны" round="round"/>
        </div>
    )
}
